import React, { useState, useEffect } from "react";
import "./App.css";
import HideAppBar from "./components/AppBar";


function App() {

const [weather, setWeather] = useState()

useEffect(() => { 
  fetch(
      `https://api.openweathermap.org/data/2.5/weather?q=Kiev,ua&appid=62029f0d3701271a5e50142b280915f0&units=metric
`
    ).then(res => res.json())
      .then(
        (result) => {
          setWeather(result.weather);
          console.log(result);
        })
}, []);
